import React, { Component } from 'react';
import AddUser from './AddUser';

export default class Table extends Component {

    state = {
        bool: 1,
        users: [
            {
                nomer: "N",
                name: "Name",
                age: "Age",
                year: "Year",
                isMarried: "Is Married",
                email: "@Email"
            },
            {
                nomer: 1,
                name: "Davlatshoh",
                age: "22",
                year: "1999",
                isMarried: "Single",
                email: "Davaltshoh99.@mail.ru"
            },
            {
                nomer: 2,
                name: "Dilshod",
                age: 21,
                year: 2000,
                isMarried: "Single",
                email: "Dilshod@mail.ru"
            },
            {
                nomer: 3,
                name: "Daler",
                age: 24,
                year: 1997,
                isMarried: "Single",
                email: "Daler@mail.ru"
            },
            {
                nomer: 4,
                name: "Shahzod",
                age: 26,
                year: 1995,
                isMarried: "Married",
                email: "Shahzod@mail.ru"
            },
            {
                nomer: 5,
                name: "Damir",
                age: 28,
                year: 1993,
                isMarried: "Married",
                email: "Damir@mail.ru"
            },
            {
                nomer: 6,
                name: "Amir",
                age: 18,
                year: 2003,
                isMarried: "Single",
                email: "Amir@mail.ru"
            },
            {
                nomer: 7,
                name: "Aziz",
                age: 19,
                year: 2002,
                isMarried: "Single",
                email: "Aziz@mail.ru"
            },
            {
                nomer: 8,
                name: "Laziz",
                age: 14,
                year: 2007,
                isMarried: "Single",
                email: "Laziz@mail.ru"
            },
            {
                nomer: 9,
                name: "Jahongir",
                age: 30,
                year: 1991,
                isMarried: "Married",
                email: "Jahongir@mail.ru"
            }
        ]
    }




    render() {
        return (
            <div className='table'>
                <div>
                    <table>
                            {
                                this.state.users.map((item, index) => <>
                                    <tr>
                                        <th>{item.nomer}</th>
                                        <th>{item.name}</th>
                                        <th>{item.age}</th>
                                        <th>{item.year}</th>
                                        <th>{item.isMarried}</th>
                                        <th>{item.email}</th>
                                    </tr>
                                </>
                                )
                            }
                        
                    </table>
                </div>

                <button onClick={this.addFunc}>Add User</button>

                {
                    this.state.bool === 1 ? <Table/> : this.state.bool === 2 ? <AddUser/> : <Table/>
                }

            </div>
        )
    }
}
